module AsciiOrder =
 struct
  (** val compare : char -> char -> comparison **)

  let compare a b =
    PeanoNat.Nat.compare (nat_of_ascii a) (nat_of_ascii b)
 end

module StringOrder =
 struct
  (** val compare : char list -> char list -> comparison **)

  let rec compare a b =
    match a with
    | [] -> (match b with
             | [] -> Eq
             | _::_ -> Lt)
    | a'::a's ->
      (match b with
       | [] -> Gt
       | b'::b's ->
         (match AsciiOrder.compare a' b' with
          | Eq -> compare a's b's
          | x -> x))

  (** val lt_dec : char list -> char list -> bool **)

  let lt_dec a b =
    let filtered_var = compare a b in
    (match filtered_var with
     | Lt -> true
     | _ -> false)
 end

(** val map_string : (char -> char) -> char list -> char list **)

let rec map_string f = function
| [] -> []
| a::s' -> (f a)::(map_string f s')

(** val ascii_dec : char coq_EqDec **)

let ascii_dec =
  (=)

(** val map_concat :
    char list -> ('a1 -> char list) -> 'a1 list -> char list **)

let map_concat separator f = function
| [] -> []
| e :: elems' ->
  fold_left (fun acc e0 -> append acc (append separator (f e0))) elems' (f e)

(** val string_reverse_helper : char list -> char list -> char list **)

let rec string_reverse_helper s acc =
  match s with
  | [] -> acc
  | x::xs -> string_reverse_helper xs (x::acc)

(** val string_reverse : char list -> char list **)

let string_reverse s =
  string_reverse_helper s []

