(** val string_exists_suffix : (char list -> bool) -> char list -> bool **)

let rec string_exists_suffix f s =
  (||) (f s)
    (match s with
     | [] -> false
     | _::tail -> string_exists_suffix f tail)

(** val like_clause_matches_string : like_clause list -> char list -> bool **)

let rec like_clause_matches_string pat s =
  match pat with
  | [] -> equiv_decb string_eqdec s []
  | l :: rest ->
    (match l with
     | Coq_like_literal literal ->
       (&&) (prefix literal s)
         (like_clause_matches_string rest
           (substring (length literal) (sub (length s) (length literal)) s))
     | Coq_like_any_char ->
       (match s with
        | [] -> false
        | _::tail -> like_clause_matches_string rest tail)
     | Coq_like_any_string ->
       string_exists_suffix (like_clause_matches_string rest) s)

(** val string_like : char list -> char list -> char option -> bool **)

let string_like str pattern escape =
  let pat_clause = make_like_clause pattern escape in
  like_clause_matches_string pat_clause str
